var tipuesearch = {"pages":[{"text":"2017Spring 機械設計工程系協同產品設計實習 課程倉儲: http://github.com/mdecourse/2017springcd 課程投影片: http://mdecourse.github.io/2017springcd 課程網誌: http://mdecourse.github.io/2017springcd/blog","url":"./pages/about/","title":"About","tags":"misc"},{"text":"一.利用python找出缺課人員 可以下載我們的課程範例中開啟w2b_cadlab看到有在上課填坐位表的修課學生 啟w2b_cadlab可以看到有修這一門課的學生 然後可以利用w2b_cadlab這裡面的程式碼來確認修課學生的缺曠課 二.在SolveSpace畫出四連桿機構 先畫出30-50-60-60四連桿基本的尺寸 再50跟30之間畫出一條隨意尺寸的線延伸到外面 方便等一下四連桿的做動 再開起課程範例裡的連桿 利用點與點的重合、線的共線及點與面的重合，限制桿子的作動 組合完之後將四連桿機構儲存成STL檔 再使用V-rep裡的Import/Mash開啟 開啟時四連桿機構會鑲進地面 可以用object/item shift調整z軸高度(記得單位是公尺) 影片 心得:利用python找出缺課人員再上有使用電腦的課程來進行點名的話似乎比雲端點名系統還要方便。 使用SolveSpace畫出四連桿機構也算是複習上學期所使用的東西，希望在將來的課程中可以進階的使用到SolveSpace這個軟體。","url":"./2017spring-cd W2.html","title":"Week2   20170228","tags":"Course"},{"text":"解決在開啟start時發生的錯誤 發生錯誤的原因: Stunnel資料夾裡的Config/Styunnel.conf裡的IP和電腦的IP不同 可以使用cmd裡使用ipconfig/all的指令找到電腦的IP位置 並將其複製貼到Styunnel.conf裡 影片 心得:以前要找到自己電腦的IP位置都要從控制台裡的無線網路連線尋找 現在只要在cmd裡打上ipconfig/all這個指令就會出現了 真是方便","url":"./2017spring-cd W1.html","title":"Week1   20170221","tags":"Course"}]};